import{_ as e,o,c as r,a as t,b as a}from"./app-de7a4551.js";const n={},i=a('<h1 id="taylor-swift" tabindex="-1"><a class="header-anchor" href="#taylor-swift" aria-hidden="true">#</a> Taylor Swift</h1><p>Taylor Swift <em>took home</em> the top prize at the 2023 MTV Video Music <code>Awards</code> (VMAs) for her Anti-Hero music video. The music network&#39;s yearly awards show <em>took place</em> at the <em><code>Prudential</code> Center</em> in Newark, New Jersey.</p><p>This is unbelievable. The fact that this is a fan-voted award means so much to me, Swift said in her <em>acceptance speech</em>. &quot;I can&#39;t believe it was a year ago that I announced the Midnights album.&quot;</p><p>The night&#39;s first <code>presenters</code> were from the male musical act NSYNC. They <code>reunited</code> to hand the best <code>pop</code> video award to Swift.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 泰勒·斯威夫特在2023年《MTV音乐录影带颁奖礼》(VMAs)上凭借《Anti-Hero》音乐视频获得了最高奖项。这一年度音乐颁奖礼在新泽西州纽瓦克的保诚中心举行。<br> “太不可思议了。这个由粉丝投票决定的奖项对我来说意义重大，”斯威夫特在获奖感言中说道。“不敢相信一年前我宣布了《午夜》专辑。”<br> 当晚首个颁奖人是男子音乐组合超级男孩(NSYNC)。他们重聚在一起，并将最佳流行音乐录影带奖颁给了斯威夫特。</p><p><strong>phrase:</strong><br> took home -&gt; 带回家/ 获得，赢得（奖项、荣誉等）<br> took place -&gt; 发生<br> Prudential Center -&gt; 普路迪申特尔中心: 位于美国新泽西州纽瓦克市的一座多功能体育场馆，是纽瓦克市的标志性建筑之一。<br> acceptance speech -&gt; 获奖感言；提名演讲；总统候选人所做的提名演讲</p><p><strong>word:</strong><br> award ( awarding, awarded, awards )<br><code>英 [əˈwɔːd]美 [əˈwɔːrd]</code></p><blockquote><p>n. 奖，奖品；（收入的）增加；（赔偿）裁定额；（毕业证书等的）授予；奖学金<br> v. 授予，颁发；判给，裁定</p></blockquote><p>prudential<br><code>英 [pruːˈdenʃ(ə)l]美 [pruːˈdenʃ(ə)l]</code></p><blockquote><p>adj. 谨慎的；明辨的</p></blockquote><p>presenter [ 复数 presenters ]<br><code>英 [prɪˈzentə(r)]美 [prɪˈzentər]</code></p><blockquote><p>n. （电视或广播节目的）主持人，主播；（仪式上的）颁奖人；演讲人，发言人；提出者；推荐者；赠送者；任命者</p></blockquote><p>reunite ( reuniting, reunited, reunites )<br><code>英 [ˌriːjuˈnaɪt]美 [ˌriːjuˈnaɪt]</code></p><blockquote><p>v. （使）团聚，（使）重聚；（使）再结合，（使）重新团结</p></blockquote><p>pop<br><code>英: [pɒp] 美: [pɑp]</code></p><blockquote><p>adv. 突然；砰地(一声)<br> n. 流行音乐；汽水；（短促清脆的爆裂声）砰；爹<br> v. （使）发砰砰声；发爆裂声；（突然或匆匆）去；（迅速或突然）放置<br> adj. 流行音乐的；通俗风格的；通俗的；现代的<br> abbr. (=printing-out paper)【摄】(利用光照直接显影的)印相纸</p></blockquote></details><p>Swift received the most <code>nominations</code> of any <code>performer</code>. Swift later returned to the stage to receive the song of the year award for Anti-hero and also the best <em><code>direction</code> award</em>.</p><p>The performer received nine awards in total. Those included artist of the year in a group of <code>nominees</code> made up of women for the first time on the VMA show. Ice Spice, who worked with Swift on Karma (Remix), won best new artist.</p><p>New music filled the show with songs from Nicki Minaj who also was the host. Minaj performed the new song Last Time I saw You. She then performed a piece from her <code>upcoming</code> Pink Friday 2 album.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 斯威夫特获得的提名是所有表演者中最多的。斯威夫特随后重返舞台，接受了《Anti-Hero》年度最佳歌曲奖和最佳导演奖。<br> 斯威夫特总共获得了九个奖项。其中包括年度最佳艺人奖，这是VMA颁奖礼上首次全部是女性提名。与霉霉合作《Karma》(混音)的埃丝·史佩斯(Ice Spice)获得最佳新人奖。<br> 节目中充满了新音乐，其中包括担任主持人的妮琪·米娜(Nicki Minaj)的歌曲。米娜演唱了新歌《Last Time I saw You》。随后，她演唱了即将发行的专辑《Pink Friday 2》中的一首歌曲。</p><p><strong>phrase:</strong><br> direction award -&gt; 导演奖</p><p><strong>word:</strong><br> nomination [ 复数 nominations ]<br><code>英 [ˌnɒmɪˈneɪʃn]美 [ˌnɑːmɪˈneɪʃn]</code></p><blockquote><p>n. 推荐；任命，指定；被提名的人（或物）</p></blockquote><p>performer [ 复数 performers ]<br><code>英 [pəˈfɔːmə(r)]美 [pərˈfɔːrmər]</code></p><blockquote><p>n. 表演者，演出者，演员；表现……的人（或事物），性能……的事物；（业绩好或业绩差的）公司，产品</p></blockquote><p>direction<br><code>英 [dəˈrekʃ(ə)n]美 [dəˈrekʃn; daɪˈrekʃn]</code></p><blockquote><p>n. 方向，方位；趋势，动向；指示，说明；目标；方面；管理，指导；导演</p></blockquote><p>nominee [ 复数 nominees ]<br><code>英 [ˌnɒmɪˈniː]美 [ˌnɑːmɪˈniː]</code></p><blockquote><p>n. 被提名者，被任命者；（投资等的）名义持有人，注册人；代名人，代名组织</p></blockquote><p>upcoming<br><code>英 [ˈʌpkʌmɪŋ]美 [ˈʌpkʌmɪŋ]</code></p><blockquote><p>adj. 即将来临的</p></blockquote></details><p>The <em>award show</em> <em>centered on</em> showing music&#39;s international power. K-pop, or Korean pop, boy group Tomorrow X Together and Brazilian artist Anitta <code>introduced</code> a new song together, Back for More.</p><p>Another K-pop group, Stray Kids, performed the song S-Class. Mexican singer Peso Pluma performed a song called Lady Gaga and Colombian singer Karol G sang Oki Doki and another song Tá OK (remix).</p><p>Tiffany Haddish <code>presented</code> the award for &quot;Best <em>Afrobeats</em>,&quot; a new award group. Afrobeats is music with influences from Africa and Black American culture. Rema and Selena Gomez won the award for the popular song Calm Down. Africa <em>in the house</em>! Rema said in his acceptance speech. Gomez said, &quot;I want to send all of my love to Nigeria, thank you.&quot;</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 颁奖典礼的重点是展示音乐的国际影响力。韩国流行音乐(K-pop)男团Tomorrow X Together和巴西歌手阿妮塔(Anitta)共同推出了新歌《Back for More》。<br> 另一个韩国流行音乐组合Stray Kids演唱了歌曲《S-Class》。墨西哥歌手比索·普拉玛(Peso Pluma)演唱了《Lady Gaga》，哥伦比亚歌手卡罗尔·G(Karol G)演唱了《Oki Doki》和《tok》(混音版)。<br> 蒂芙尼·哈迪什(Tiffany Haddish)颁发了“最佳非洲节奏”奖，这是一个新的奖项。“非洲节奏(Afrobeats)”是一种受非洲和美国黑人文化影响的音乐。雷马(Rema)和赛琳娜·戈麦斯(Selena Gomez)凭借流行歌曲《冷静下来》(Calm Down)获得了该奖项。“非洲在这里!” 雷马在接受奖时说道。戈麦斯说：“向尼日利亚致以我所有的爱，谢谢。”</p><p><strong>phrase:</strong><br> award show -&gt; 颁奖典礼<br> center on -&gt; 以……为中心<br> Afrobeats -&gt; 非洲节拍<br> in the house -&gt; 在这里 / 在场</p><p><strong>word:</strong><br> introduce ( introducing, introduced, introduces )<br><code>英 [ˌɪntrəˈdjuːs]美 [ˌɪntrəˈduːs]</code></p><blockquote><p>v. 介绍，引见；使初次了解，使尝试；为（电视或广播节目）做开场白，主持；实施，推行；首次引入（某物），使传入；使开始，创始；将（法案）提交讨论；将……放进，添入</p></blockquote><p>present ( presenting, presented, presents )<br><code>英: [ˈprez(ə)nt] 美: [ˈprezənt]</code></p><blockquote><p>n. 目前；现在；礼物；礼品<br> adj. 存在；出席；在场；出现<br> v. 出现；提出；显示；提交；颁发</p></blockquote></details><p>Colombian star Shakira received the Video <code>Vanguard</code> Award and performed a mix of her popular songs.</p><p>MTV, thank you for being such a big part of my career since I was only 18 years old, Shakira said. She also thanked her parents and her children, who she brought to the show.</p><p>This is for you my people, my Latin American people, inside and outside this country, she said in the Spanish language. Diddy received the Global Icon Award from Mary J. Blige and his daughter Chance Combs. He is the third act to receive the award, after the Red Hot <em><code>Chili</code> Peppers</em> in 2022 and the Foo Fighters in 2021.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 哥伦比亚明星夏奇拉(Shakira)获得了音乐录影带先锋奖，并演唱了她的几首热门歌曲。</p><p>夏奇拉说:“MTV，感谢你从我18岁起就成为我职业生涯中重要的一部分。”她还感谢了她的父母和孩子们，她把他们带到了颁奖典礼现场。</p><p>“这是给你们的，我的粉丝，拉美亲人，以及世界各地的朋友们。”她用西班牙语说。吹牛老爹从玛丽·J·布莱奇(Mary J. Blige)和他的女儿康斯·库姆斯(Chance Combs)手中获得了全球偶像奖。他是继2022年的红辣椒乐队(Red Hot Chili Peppers)和2021年的喷火战机乐队(Foo Fighters)之后，第三位获得该奖项的艺术家。</p><p><strong>phrase:</strong><br> chili pepper -&gt; 辣椒：一种辛辣的植物，常用于调味或烹饪。</p><p><strong>word:</strong><br> vanguard [ 复数 vanguards ]<br><code>英 [ˈvænɡɑːd]美 [ˈvænɡɑːrd]</code></p><blockquote><p>n. 先锋；前锋科学卫星</p></blockquote><p>chili [ 复数 chilies或chilis ]<br><code>英 [ˈtʃɪli]美 [ˈtʃɪli]</code></p><blockquote><p>n. 红辣椒，辣椒</p></blockquote></details><p>The artist also performed at the VMAs for the first time since 2005. The performance was <em>a <code>collection</code> of</em> some of his most popular songs like Bad Boy for Life and Mo Money Mo Problems.</p><p>Lil Wayne opened the show with a performance of his new single Kat Food. Olivia Rodrigo then brought her <code>Vampire</code> music video to the stage before performing Get Him Back!</p><p>Later, Anitta would win the &quot;best Latin&quot; award for the second year. In her acceptance speech, she laughed, saying, &quot;I wanna thank myself.&quot; And she added, &quot;Because I work so hard!&quot;</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 这也是他自2005年以来首次参加VMA颁奖礼。他还表演了《Bad Boy for Life》和《Mo Money Mo Problems》等他最受欢迎的歌曲。<br> 李尔·韦恩(Lil Wayne)以他的新单曲《Kat Food》开场。奥利维亚·罗德里戈(Olivia Rodrigo)在表演《Get Him Back!》之前把她的《吸血鬼》MV带到了舞台上。<br> 之后，阿妮塔(Anitta)第二年获得了“最佳拉丁”奖。在获奖感言中，她笑着说:“我要感谢自己。”她又说:“因为我工作太努力了!”</p><p><strong>phrase:</strong><br> a collection of -&gt; 一组；一系列；一堆；一批</p><p><strong>word:</strong><br> collection [ 复数 collections ]<br><code>英 [kəˈlekʃ(ə)n]美 [kəˈlekʃ(ə)n]</code></p><blockquote><p>n. 收藏品，收集物；募捐；一堆（东西），一群（人）；系列时装；专辑，作品集；领取，收取；收集，采集；收账，收债；&lt;英&gt;（尤指牛津大学的）学院期初（或期末）考试</p></blockquote><p>vampire [ 复数 vampires ]<br><code>英 [ˈvæmpaɪə(r)]美 [ˈvæmpaɪər]</code></p><blockquote><p>n. （故事中的）吸血鬼；（喻）无情掠夺者，吸血鬼；吸血蝙蝠；（戏剧）（舞台的）活板门</p></blockquote></details><p>French Montana, a performer who presented an award, <em>brought attention to</em> an effort to provide <em><code>aid</code> to</em> <code>victims</code> of the Morocco earthquake. The performer grew up in Morocco.</p><p>The VMA show ended with a celebration of 50 years of the musical form hip-hop. It included Nicki Minaj, Lil Wayne, LL Cool J, and DMC of Run-DMC.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 颁发奖项的表演者弗伦奇·蒙大拿(French Montana)提醒人们关注向摩洛哥地震受害者提供援助的努力。这位表演者在摩洛哥长大。<br> VMAs最后以庆祝嘻哈音乐形式诞生50周年落幕。表演者包括妮琪·米娜(Nicki Minaj)、李尔·韦恩(Lil Wayne)、里·库尔·j(LL Cool J)和大嘴跑火车组合(Run-DMC)。</p><p><strong>phrase:</strong><br> bring attention to -&gt; 引起注意：使某人或某事物引起他人的注意或关注<br> aid to -&gt; 帮助或支持：提供帮助或支持的行为或手段。</p><p><strong>word:</strong><br> aid ( aiding, aided, aids )<br><code>英 [eɪd]美 [eɪd]</code></p><blockquote><p>n. 帮助；援助，救助；辅助物，辅助设施；助手；特别津贴，国库税<br> v. 帮助，援助；促进，有助于</p></blockquote><p>victim [ 复数 victims ]<br><code>英 [ˈvɪktɪm]美 [ˈvɪktɪm]</code></p><blockquote><p>n. 受害者，罹难者；（面对不幸事件或虐待时的）无助者，患病者；牺牲品，祭品；受骗者</p></blockquote></details>',24);function s(d,c){return o(),r("div",null,[t(" “霉霉”泰勒·斯威夫特获得MTV最高奖 "),i])}const l=e(n,[["render",s],["__file","15-swift.html.vue"]]);export{l as default};
